import React from "react";

function Note(props) {
    return ( <
        div className = "note" >
        <
        div className = "cardHeading" >
        <
        h1 > { props.name } < /h1> <
        p > { props.address } < /p> <
        /div>

        <
        p > { props.from }
        to { props.to } <
        /p> <
        p > { props.available_capacity_dose1 } < /p> <
        p > { props.available_capacity_dose2 } < /p> <
        p > { props.vaccine } < /p> <
        /div>
    );
}

export default Note;
